import './Expenses.css'
import ExpenseItem from './ExpenseItem';

function Expenses(props) {
  const Array = [...props.array]

  Array.map((element) => {
    return (
      <ExpenseItem 
      title={element.title}
      amount={element.amount}
      date={element.date}

      />
    );
  })
}

export default Expenses;
